import React from "react";
import "./Navbar.css";
import Home from '@material-ui/icons/Home';
import { NavLink } from 'react-router-dom';
import Logo from './Logo.png';
import useState from "usestate";

const Navbar = () => {
    const [sitestyle, setStyle] = useState("bg");
    return (
        <container className={sitestyle}>
            <div className="Navbar">
                <NavLink exact activeClassName="Active" to="/" onClick={() => { setStyle("bg") }} className="a"><Home /></NavLink>
                <NavLink exact activeClassName="Active" to="./department" className="a">Department </NavLink>
                <NavLink exact activeClassName="Active" to="./Event" className="a">Event </NavLink>
                <NavLink exact activeClassName="Active" to="/admission" className="a">Admission</NavLink>
                <NavLink exact activeClassName="Active" to="/TP" className="a">T&P</NavLink>
                <NavLink exact activeClassName="Active" to="Library" className="a">Library</NavLink>
                <NavLink exact activeClassName="Active" to="/Notification" className="a">Notification</NavLink>
                <NavLink exact activeClassName="Active" to="/Campus" className="a">Campus</NavLink>
            </div>
            <div className="whiteLogo">
                <img src={Logo} alt="" width="50em" height="50em" srcset="" />
            </div>

        </container>


    );
}

export default Navbar;
